import React from "react";
import Moment from 'react-moment';
import { Link } from "react-router-dom";
import '../index.css'
import { AiOutlineRead, AiOutlineStar, AiOutlineCheck, AiOutlineFileImage } from 'react-icons/ai'


export const PostItem = ({ post }) => {
    if (!post) {
        return (
            <div>
                Завантаження...
            </div>
        )
    }

    return (
        <Link to={`/${post._id}`} className='link-item'>
         <div className="postItem">
                <div className="postHeader">
                    <h3 className="postTitle"><AiOutlineStar size={25} style={{ marginRight:'10px'}} />{post.model}</h3>
                    <Moment date={post.createdAt} format='D MMM YYYY' className="postData"/>
                </div>
                <div className="postBlock">
                    <p><AiOutlineCheck size={25} style={{ marginRight:'10px'}}  />{post.urlOff}</p>
                    <p><AiOutlineRead size={25} style={{ marginRight:'10px'}}  />{post.urlBook}</p>
                    <p><AiOutlineFileImage size={25} style={{ marginRight:'10px'}} />URL img</p>
                    <div><p>{post.info}</p></div>
                </div>
        </div>
        </Link>

)}
